This is a fixed version of my previous torrent from a much better source; previously I had used MTCDC and found some pages were in the wrong order. These newer, better scans are from various Team-DCP scanners (including AvalonSCC and TenChiefs) and there are no ads in this release. Also, I have added the Titans East one-shot special (also DCP) that starts off this whole series. I will leave my previous torrent up but this is the definite version of the Winnick run until a digital copy is made, so I suggest you upgrade for a smoother and more coherent reading experience. Sorry about the previous torrent, thanks to all the DCP scanners for these awesome prints and as always, please seed and enjoy! :-)
